import React from 'react';
import TextInput from '../FormInput/TextInput.tsx/TextInput';

interface IProps{
  children?: React.ReactNode,
  poll_data:string[]
}

function PollForm(poll_data:IProps) {
  return (
    <section className='Section'>
      <div>
        <TextInput value="" name="poll_question" placeholder="Poll question" />

        <div className='PollQuestion'>
            {
              poll_data.map(()=>{
                return(
                  <TextInput value="" name="poll_question" placeholder="Poll question" />
                )
              })
            }
        </div>
      </div>
    </section>
  )
}

export default PollForm
